function App() {
  return (
    <div className="container-fluid  bg-dark">
      <h1 className="display-2 text-light text-center">
        FreysSupport - Développement en cours
      </h1>
      <h4 className="text-light text-center">
        Merci de votre visite, si vous voulez être tenu de l'avancement du site
        vous pouvez vous rendre sur notre instagram : @freyssupport
      </h4>
    </div>
  );
}

export default App;
